    <style>
        * {
            margin: 0;
            padding: 0;
            outline: none;
        }

        body {
            background: rgba(52, 58, 65, 0.600000);
            backdrop-filter: blur(15px);
            /*potential issue: minimal browser support*/
            -webkit-backdrop-filter: blur(15px);
            /*for safari*/
            height: 100%;
        }

        #ad_iframe {
            box-shadow: 0 !important;
            display: block;
            left: auto;
            margin: 0 auto;
            position: relative;
            top: auto;
        }

        .creative {
            transition: opacity 1s;
            -webkit-transition: opacity 1s;
            position: relative;
        }

        #card {
            background-color: #fff;
            border-radius: 6px;
            padding: 0 6px 1px;
            position: relative;
            box-shadow: 0px 8px 12px rgba(60, 64, 67, 0.15), 0px 4px 4px rgba(60, 64, 67, 0.3);
        }

        html {
            height: 100%;
        }

        .toprow {
            width: 100%;
            display: table;
            height: 24px;
            background-color: #fff;
        }

        .btn {
            display: table;
            transition: opacity 1s, background .75s;
            -webkit-transition: opacity 1s, background .75s;
            -moz-transition: opacity 1s, background .75s;
            -o-transition: opacity 1s, background .75s;
            background: transparent;
            color: #fff;
        }

        .btn>div {
            display: table-cell;
            vertical-align: middle;
        }

        .skip {
            opacity: 0.95;
            padding: 12px 12px 0;
            float: right;
        }

        .skip svg {
            height: 1.5em;
            width: 1.5em;
            margin-left: -0.5em;
            margin-right: -0.5em;
            vertical-align: middle;
            padding-bottom: 1px;
        }

        .report {
            opacity: 0.55;
            padding: 12px 2px 0;
            float: right;
            cursor: pointer;
            visibility: visible;
        }

        .heading {
            font-size: 12px;
            font-weight: 700;
            font-family: 'Roboto', arial, sans-serif;
            color: #202124;
            position: relative;
            height: 25px;
            padding: 12px 16px 0;
            float: left;
        }

        .report svg {
            height: 1.5em;
            width: 1.5em;
            margin-left: -0.3em;
            margin-right: -0.3em;
            vertical-align: middle;
            padding-bottom: 1px;
        }

        .attribution {
            position: relative;
            padding: 0;
            margin: 12px 4px 0;
            float: right;
        }

        #ad_position_box {
            display: flex;
            align-items: center;
            justify-content: center;
            height: 100%;
            width: 100%;
        }
    </style>
</head>

            <style>
                .pull-icon {
                    float: right;
                }

                [dir= "rtl "] .pull-icon {
                    float: left;
                }

                .interstitial-survey-wrapper {
                    background-color: rgba(0, 0, 0, 0.8);
                    bottom: 0px;
                    opacity: 1.0;
                    overflow-y: auto;
                    position: absolute;
                    left: 0px;
                    top: 0px;
                    width: 100%;
                    z-index: 10000;
                }

                .interstitial-survey {
                    display: block;
                    font-size: 16px;
                    margin: 96px auto;
                    width: 320px;
                    max-width: 92%;
                }

                .interstitial-survey span,
                .interstitial-menu span {
                    display: inline-block;
                }

                .interstitial-survey img {
                    height: 24px;
                    margin-top: 12px;
                    width: 24px;
                }

                .interstitial-survey div {
                    display: block;
                    width: 100%;
                }

                .survey-header {
                    background-color: #4285f4;
                    color: #FFFFFF;
                    display: block;
                    height: 64px;
                    line-height: 64px;
                    width: 100%;
                    border-top-left-radius: 3px;
                    -moz-border-top-left-radius: 3px;
                    -webkit-border-top-left-radius: 3px;
                    border-top-right-radius: 3px;
                    -moz-border-top-right-radius: 3px;
                    -webkit-border-top-right-radius: 3px;
                }

                .survey-header span {
                    font-size: 1.25em;
                    font-family: 'Roboto-Light', arial, sans-serif;
                    padding: 0 24px;
                    white-space: nowrap;
                }

                .btn-section-container {
                    border-radius: 3px;
                    -moz-border-radius: 3px;
                    -webkit-border-radius: 3px;
                    background-color: #FFFFFF;
                    margin-bottom: 8px;
                }

                .btn-section {
                    padding: 0.8em 0px;
                }

                .btn-section a {
                    cursor: pointer;
                }

                .btn-section a,
                .survey-confirmation-header,
                .survey-confirmation-closing {
                    box-sizing: border-box;
                    display: block;
                    padding: 0 24px;
                    width: 100%;
                }

                .btn-section a span,
                .survey-confirmation-header span,
                .survey-confirmation-closing span {
                    color: rgba(0, 0, 0, 0.54);
                    font-family: 'Roboto-Medium', arial, sans-serif;
                    font-size: 1em;
                    margin: 14px 0;
                    max-width: 224px;
                }

                .menu-container {
                    position: absolute;
                    z-index: 10000;
                }

                .menu-left {
                    left: 15px;
                }

                .menu-right {
                    right: 15px;
                }

                [dir= "rtl "] .menu-left {
                    left: initial;
                    right: 15px;
                }

                [dir= "rtl "] .menu-right {
                    left: 15px;
                    right: initial;
                }

                .menu-upper {
                    top: 15px;
                }

                .menu-lower {
                    bottom: 15px;
                }

                .menu-btn-section {
                    padding: 5px 0;
                    margin: 0;
                    box-shadow: 0 0 3px 3px rgba(0, 0, 0, 0.2);
                }

                .menu-btn-section img {
                    height: 21px;
                    margin: 3px 14px 0 0;
                }

                [dir= "rtl "] .menu-btn-section img {
                    margin: 3px 0 0 14px;
                }

                .menu-btn-section a {
                    box-sizing: border-box;
                    display: table;
                    padding: 0 14px;
                    width: 100%;
                }

                .menu-btn-section a div {
                    display: table-cell;
                    vertical-align: middle;
                }

                div.img-container {
                    width: 35px;
                }

                .menu-btn-section a span {
                    display: inline-block;
                    color: #212121;
                    font-family: 'Roboto-Regular', arial, sans-serif;
                    font-size: 14px;
                    margin: 11px 0;
                    max-width: 224px;
                }

                .survey-confirmation-header span {
                    opacity: 0.7;
                }

                .interstitial-menu {
                    position: absolute;
                    top: 12px;
                    left: 12px;
                }
            </style>
